package javacode;

import java.util.HashMap;
import java.util.Map;

public class UniqueCharacterInString387 {
    public static void main(String[] args) {
        int index = -1;
        HashMap<Character, Integer> result = new HashMap();
        String s = "";
        for (int i = 0; i < s.length(); i++) {
            if (result.containsKey(s.toCharArray()[i])) {
                result.put(s.toCharArray()[i], result.get(s.toCharArray()[i]) + 1);
            } else {
                result.put(s.toCharArray()[i], 1);
            }
        }

        for (int i = 0; i < s.length(); i++) {
            if (result.get(s.toCharArray()[i]) == 1) {
                System.out.println("resul is " + i);
                index = i;
                break;
            }
        }

        System.out.println(index);
        System.out.println(result);
    }
}
